import React from "react";
import InfluencerNavbar from "../../../components/InfluencerNavbar";

const earningsData = [
  {
    id: 1,
    campaign: "Streetwear Collab",
    brand: "UrbanVerse",
    amount: 4000,
    status: "Paid",
    date: "June 29, 2025",
  },
  {
    id: 2,
    campaign: "Summer Skincare Launch",
    brand: "Glowify Skincare",
    amount: 5000,
    status: "Pending",
    date: "Expected: July 12, 2025",
  },
  {
    id: 3,
    campaign: "Reel Challenge",
    brand: "Zest Beverages",
    amount: 3000,
    status: "Paid",
    date: "June 26, 2025",
  },
];

const Earnings = () => {
  const total = earningsData.reduce((sum, e) => sum + e.amount, 0);

  return (
    <>
      <InfluencerNavbar />
      <div className="p-6 max-w-5xl mx-auto">
        <h1 className="text-3xl font-bold text-purple-600 mb-4 text-center">Earnings Overview</h1>

        <div className="bg-purple-100 text-purple-800 rounded-lg p-4 mb-6 text-center text-xl font-semibold">
          Total Earnings: ₹{total}
        </div>

        <table className="w-full table-auto border-collapse shadow-sm">
          <thead>
            <tr className="bg-purple-100 text-purple-800 text-left">
              <th className="p-3">Campaign</th>
              <th className="p-3">Brand</th>
              <th className="p-3">Amount (₹)</th>
              <th className="p-3">Status</th>
              <th className="p-3">Date</th>
            </tr>
          </thead>
          <tbody>
            {earningsData.map((item) => (
              <tr key={item.id} className="border-b hover:bg-purple-50">
                <td className="p-3 font-medium">{item.campaign}</td>
                <td className="p-3">{item.brand}</td>
                <td className="p-3">₹{item.amount}</td>
                <td className="p-3">
                  <span
                    className={`px-3 py-1 rounded-full text-sm font-semibold ${
                      item.status === "Paid"
                        ? "bg-green-200 text-green-700"
                        : "bg-yellow-200 text-yellow-800"
                    }`}
                  >
                    {item.status}
                  </span>
                </td>
                <td className="p-3">{item.date}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </>
  );
};

export default Earnings;
